import styled from 'styled-components';

export const HomeWrapper=styled.div`

width:960px;
margin:0 auto;
background:green;
`
export const HomeLeft=styled.div`
float:left
width:625px;
padding-left:15px;
padding-top:30px;
.banner-img{
    width:625px;
    height:270px;
}
`
export const HomeRight=styled.div`
float:right;
margin-left:40px;
padding-top:30px;
`
export const ListItem=styled.div`
float:left;
padding:15px 2px 20px;
margin-bottom:15px;
border-bottom:1px solid #f0f0f0;
.pic{
    display:block;
    float:right;
    width:150px;
    height:100px;
}
`
export const ListInfo=styled.div`
margin:0 0 8px;
font-size:13px;
line-height:24px;
color:#999;
box-sizing:border-box;

.title{
    margin:-7px 0 4px;
    font-size:18px;
    font-weight:700px;
    line-height:1.5;

}
`
